import React from "react";
import { FaInstagram, FaLinkedin } from "react-icons/fa";
import "../style/";

const profiles = [
  { name: "John Doe", phone: "+1234567890", image: "https://via.placeholder.com/150" },
  { name: "Jane Smith", phone: "+9876543210", image: "https://via.placeholder.com/150" },
  { name: "Alice Johnson", phone: "+1122334455", image: "https://via.placeholder.com/150" },
  { name: "Bob Brown", phone: "+5566778899", image: "https://via.placeholder.com/150" },
  { name: "Charlie Davis", phone: "+6677889900", image: "https://via.placeholder.com/150" },
  { name: "Emma Wilson", phone: "+7788990011", image: "https://via.placeholder.com/150" },
];

function ProfileCard({ name, phone, image }) {
  return (
    <div className="card">
      <img src={image} alt={name} className="profile-image" />
      <h3>{name}</h3>
      <p>{phone}</p>
      <div className="icons">
        <FaInstagram className="icon" />
        <FaLinkedin className="icon" />
      </div>
    </div>
  );
}

function Contact() {
  return (
    <div className="card-container">
      {profiles.map((profile, index) => (
        <ProfileCard key={index} {...profile} />
      ))}
    </div>
  );
}

export default Contact;
